export const getEvents = (location) => {
    var myHeaders = new Headers();
    myHeaders.append("Access-Control-Allow-Origin", "*");
    return fetch("https://public.opendatasoft.com/api/records/1.0/search/?dataset=arome-0025-sp1_sp2", {
        method: "GET",
    }).then((res) => {
        return res.json();
    }).catch((err) => {
        console.log(err);
    });
}
